import React from "react";
import { Container } from "react-bootstrap";
import { useSelector } from "react-redux";

function PlayerInMatch() {
    const calendar = useSelector((state) => state.tour.calendar)
    const allTeam = useSelector((state) => state.tour.allTeams)

    return <Container className="mt-5">PlayerInMatch</Container>;
}

export default PlayerInMatch;
